        if(path[1] == __tokenB) {
            require(ERC20(__tokenB).balanceOf(address(this)) >= amountOutMin, "Not enough tokens B");
        } else {
            require(ERC20(__tokenA).balanceOf(address(this)) >= amountOutMin, "Not enough tokens A");
        }

        /// Approve and transfer amountIn
